}

  render() {
    const classpage = { 
  pathname: "/classpage", 
  classTitle: this.props.classTitle,
  classDescription: this.props.classDescription,
};
    return (
    	<div>
        <Link to={classpage}>
          <h3 className="titleStyle">{this.props.classTitle}</h3> 
        </Link>
    		//<Link to="/classpage"> <h3 className="titleStyle">{this.props.classTitle}</h3> </Link>
        //classtitle & classdescribtion
    		<div className="row">
          <div className="col-sm-6 text-secondary">
            Instructor: {this.props.instructor}
          </div>
          <div className="col-sm-6 text-secondary">
            Meeting day: {this.props.meetingDay}
          </div>
        </div>
    	</div>
    );
  }
}

export default ClassList;
